script: |
  super -f tsv -I q8343.sql | sort > q8343.out

vector: true

inputs:
  - name: q8343.sql
    data: |
      pragma pg
      SELECT ALL + col0 AS col0 FROM tab0 GROUP BY col1, col0 HAVING - col1 NOT BETWEEN ( + col1 + - ( - + col0 ) * - + COUNT ( * ) ) AND ( NULL );
  - name: tab0

outputs:
  - name: q8343.out
    data: |
      43
